window.bookSummaryJSON = "<p><b>My father is a genius.</b></p> <p>A scientist determined to unlock human potential.</p> <p>Only his experiments? He conducted them on me.</p> <p>I managed to escape his cruel, painful control, and for years I hid. Until one day, news comes of his death. Along with the fact his experiments are still being carried out.</p> <p>This time I cannot run, I cannot hide. I must stop them once and for all.</p> <p>He thought he was invincible…. but me? I'm unstoppable.</p> <p><i>Unstoppable </i>is the first book in the Pretty Liars duet. Intended for mature listeners.</p>"; 
